const App=()=> {



  const expenses =[
    {title : 'FOOD',
    amount: 200,
    date : new Date(2022,7 ,14)
  },
  {
    title:'SHOES',
    amount:3000,
    date:new Date(2022,3 ,16)
  },
  {
    title:'CLOTHES',
    amount:6000,
    date:new Date(2022,9 ,15)
  },
  ];

  const expenseHandler = (expense)=>{
    console.log('New Expense added');
    console.log(expense);
  }
  return (
    <div>

      <NewExpenses onAdding = {expenseHandler}/>

      <Expenses items = {expenses}/>
    </div>
  );
}

export default App;
